String? findNearestAirport(double lat, double lon) {
  double bestDistance = double.maxFinite;
  String? bestCode;
  airportCoordinates.forEach((code, coords) {
    final dLat = lat - coords[0];
    final dLon = lon - coords[1];
    final distance = dLat * dLat + dLon * dLon;
    if (distance < bestDistance) {
      bestDistance = distance;
      bestCode = code;
    }
  });
  return bestCode;
}
